import React from 'react';
import logo from './logo.svg';
import './App.css';
import Todo from './components/Todo';
function App() {
  return (
    <div className="App">
      <header>
        Mac's Todo Project
      </header>
      <section>
        <Todo />
      </section>
    </div>
  );
}

export default App;
